sys_variable_value.value:
(function execute(inputs, outputs) {

    if (gs.nil(inputs.properties)) {
        outputs.property_value = inputs.default_value;
        return;
    } else {
        var parsed = JSON.parse(inputs.properties);
        outputs.property_value = parsed[inputs.property_name.toString()];

        if (gs.nil(outputs.property_value))
            outputs.property_value = inputs.default_value;

    }
})(inputs, outputs);

